import React, { useState, useEffect } from 'react';

const SoftwareSkill = ({ software }) => {

const [hasLoaded, setHasLoaded] = useState(false)

useEffect(() => {
    setHasLoaded(true) 
  }, [])

    return (
        <li className="skill-container">
          <p className="skill-name"> {software.name} </p>
          <div className="skill-bar-base">
            <div className={`skill-bar-filler ${software.id}`}
              style={{ width: hasLoaded ? `${software.level}%` : 0 }} >
            </div>
          </div>
        </li>
      )
}

export default SoftwareSkill;
